import React from 'react';
import { Link } from 'react-router-dom';
import './HLinks.css';

export default function HLinks() {
  return (
    <div className="links_cont">
      <Link to='/newgame' className="link_ng">
        <h3 className="link_ng">Crear nuevo</h3>
      </Link>
      <Link to='/' className="link_ng">
        <h3 className="link_ng">Salir</h3>
      </Link>
    </div>
  )
}
